import axios from "axios";

const apiClient=axios.create(
  {
      baseURL:'http://localhost:8080/'
  }
)
export const LoginCall=(email,password)=> apiClient.post(`/login`,JSON.stringify({
  email: email,
  password: password}),
)
export const LogoutCall=()=> apiClient.get(`/logout`)
